import Link from 'next/link';

const About = () => (
  <div>
    <h1>About</h1>
    <a href="/">go to home</a>
    <p>A Javascript Programmer</p>
    <img src="/static/javascript-logo.png" alt="Javascipt" height="200px"/>
  </div>
);

export default About;
